import React,{useState} from 'react'
import ChatBubbleIcon from '@material-ui/icons/ChatBubble';
import ClearIcon from '@material-ui/icons/Clear';


export default function ChatBot() {
    
    const[init,upda] = useState("none");

    const openn=()=>{
       upda("block")
    }

    const closee=()=>{
       upda("none")
    }

    return (
        <div>


            <div style={{width:"45rem", height:"45rem",backgroundColor:"rgb(205, 186, 109)",position:"fixed",left:"20px",bottom:"65px",cursor:"pointer",zIndex:"999999",borderRadius:"10px",display:init}}>
                <div style={{position:"relative"}}>
                <h1 style={{textAlign:"center",}}>Contact Us</h1>
                <ClearIcon onClick={closee} style={{fontSize:'4rem',position:"absolute",right:"10px",top:"4px"}}/>
                </div>
            </div>


          <ChatBubbleIcon onClick={openn} style={{width:'5rem',height:"5rem",color:"rgb(205, 186, 109)",position:"fixed",left:"20px",bottom:"14px",cursor:"pointer",zIndex:"999999"}}/>  
        </div>
    )
}
